import './App.css';
import Header from './components/header';
import AddTimeTable from './components/AddTimeTable';

import {BrowserRouter as Route, Routes} from 'react-router-dom'



function App() {
  return (


    <Routes>

        <Header/>
          <Route path="/AddTimeTable" element={AddTimeTable}/>



        </Routes>




  );
}

export default App;
